import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
export default function Home() {
  const [data, setData] = useState([]);
  useEffect(() => {
    getData();
  }, []);

  const getData = () => {
    axios
      .get("http://localhost:9000/all")
      .then((res) => {
        if (res.status) {
          setData(res.data.data);
        }
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  return <div>Home</div>;
}
